var _emoji_trie *trie.RuneTrie

func init() {
	_emoji_trie = new(trie.RuneTrie)
	for _, s := range _emojis {
		_emoji_trie.Insert([]rune(s))
	}
}

func Match(key string) bool {
	/* 输入字符串, 返回是否全是emoji */
	rs1 := []rune(key)
	// 纠错: 比如0032 FE0F 20E3, ios会发成0032 20E3 FE0F
	var rs []rune
	//for _, c := range rs1 {
	//	if c != 0xFE0F {
	//		rs = append(rs, c)
	//	}
	//}
	rs = rs1
	for len(rs) > 0 {
		n := _emoji_trie.LongestPrefix(rs)
		if n <= 0 {
			return false
		}
		rs = rs[n:]
	}

	return true
}

// 计算含有表情符号的字符串的字数
// 比如: ❤️占两个unicode, 最后会当成1个字.
// 备注: unicode 12.0, 最长的emoji占8个unicode.
func Length(s string) int {
	rs := []rune(s)
	length := 0
	for ; len(rs) > 0; length++ {
		n := _emoji_trie.LongestPrefix(rs)
		if n <= 0 {
			n = 1
		}
		rs = rs[n:]
	}
	return length
}
